import React from 'react'
import './css/Description.css'
export default function Description(
    {padding, height, descriptWidth, alignItems, titleSize, yearSize, descriptSize, languagesSize, title, year, descript, languages}) {
    return (
        <div id="description-wrapper" 
        style={{padding: padding, alignItems: alignItems}}>
        <h1 style={{fontSize : titleSize, textAlign: 'left', backgroundColor: 'red'}} id="project-title">{title}</h1>
        <h1 style={{fontSize: yearSize}} id="year">{year}</h1>
        <p style={{fontSize: descriptSize, width: descriptWidth}} id="descript">{descript}</p>
        <p style={{fontSize: languagesSize }} id="l">{languages}</p>
    </div>
    )
}
